package com.auxiliary.designer.visitor;public class PopulationVisitor implements IVisitor {    private String comageDetail;    private String manageDetail;    @Override    public void visit(CommonEmployee employee) {        comageDetail += employee.getAge()+";";    }    @Override    public void visit(Manager manager) {        manageDetail += manager.getAge() + ";";    }    @Override    public void report() {        System.out.printf("employee age detail %s employer age detail %s" , comageDetail , manageDetail);    }}